import React, { Component } from "react";
import { Button } from "react-bootstrap";

class Arm extends Component {
  state = { ros: null };
  constructor() {
    super();
    this.init_connection();
  }
  init_connection() {
    this.state.ros = new window.ROSLIB.Ros();
  }

  render() {
    return <Button variant="primary">Arm</Button>;
  }
}

export default Arm;
